  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Audubon
  National Wildlife Refuge outlines Refuge accomplishments during the 2001 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses the master plan, management
  planning, public participation, compliance with environmental mandates, and research
  and investigations. Refuge administration is outlined; information about personnel,
  youth programs, volunteer programs, funding, safety, and technical assistance is
  given. Habitat management is also covered; subjects include wetlands, forests, croplands,
  grasslands, other habitats, grazing, haying, fire management, pest control, and
  water rights. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, waterfowl, marsh and water birds, shorebirds, raptors, other
  migratory birds, game mammals, other resident wildlife, fishery resources, surplus
  animal disposal, animal control, animal control, and marking and banding. The public
  uses of the Refuge described in this report include outdoor classrooms, information
  and interpretation, hunting, fishing, trapping, wildlife observation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment utilization and replacement,
  communication systems, and energy conservation. Cooperative programs are discussed,
  as well. Narrative reports for Audubon Wetland Management District, Lake Nettie,
  McLean, Lost Lake, Lake Otis, Sheyenne Lake, Camp Lake, and Strawberry Lake National
  Wildlife Refuges and are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
